import React, {useEffect, useState} from 'react';
import {Outlet, useLocation, useNavigate} from "react-router-dom";
import workbench from '../../style/workbench/workbench.module.css'

const Entire = () => {
	// 导航跳转
	const navigate = useNavigate();
	const navigateTo = e => {
		e.preventDefault();
		navigate(`./${e.target.id}`);
	}

	// 根据当前所在工作台页面给导航栏动态添加className
	const [className, setClassName] = useState('');
	useEffect(() => {
		const location = useLocation();
		const nowBench = location.pathname.split('/').at(-1);

	}, [location]);


	return (
		<div className={workbench.entire}>
			<div className={workbench.navBox}>
				<span>{'工作台'}</span>
				<div className={workbench.navContent}>
					<div onClick={navigateTo} id={'edit'}>{'创建新问卷'}</div>
					<div onClick={navigateTo} id={'draft'}>{'草稿'}</div>
					<div onClick={navigateTo} id={'published'}>{'已发布的问卷'}</div>
					<div onClick={navigateTo} id={'involved'}>{'参与过的问卷'}</div>
				</div>
			</div>
			<Outlet/>
		</div>
	);
};

export default Entire;
